# *Chegando na primeira salinha, Alice se depara com um frasco de 800ml escrito "BEBA-ME" e um bolo 750g escrito "COMA-ME". Sem desconfiar de nada, Alice toma **630ml** do frasco e come **570g** do bolo. O que ela não sabia é que a bebida a fazia encolher **120cm** quando tomada inteira e o bolo a fazia crescer **190cm** quando comido inteiro.* 
# 
# Considerando que os efeitos das mudanças de altura são proporcionais à quantidade ingerida e que Alice possui inicialmente 1,61m, qual foi a altura final de Alice?
# 
