# In[19]:


#####SEU CODIGO COMECA AQUI#####
#variável que representa altura da Alice inicialmente em centímetros#
al1 = 161

#variável com frasco completo do líquido em ml#
x1 = 800

#variável com o tamanho que pode se encolher em cm, caso beba o frasco completo
y1 = 120

#variável que representa o quanto que a Alice bebeu da capacidade do frasco, em ml
z1= 630

