# ## **Ex.3 - Desaniversário** 
# 
# ![image.png](data:image/png;base64,)
# 
# *Passado algum momento, as luzes se apagaram e o Chapeleiro acendeu as velas do bolo. É que no País das Maravilhas, são comemorados os "desaniversários" ou, todos os dias que não são seu aniversário. Alice achou estranho, mas pensou bem e achou a ideia muito interessante afinal, poderia ganhar presentes em 364 dias do ano. Como fazia aniversário dia 4 de maio, os anos bissextos seriam melhores ainda, pois poderia ganhar um presente a mais*
# 
# Seguindo esse pensamento, faça um programa que leia um ano qualquer e mostre se ele é bissexto
# 
# Print sua resposta da seguinte forma -> **O ano X é bissexto** ou **O ano Y não é bissexto**

# In[2]:


#####SEU CODIGO COMECA AQUI#####

#Primeiro analisamos os requisitos que fazem um ano ser bissexto ou não.
# Após uma breve pesquisa, entende-se que para um ano ser bissexto, ele tem que respeitar duas regras: ser divisível por 4, e para os número múltiplos de 100, o número tem que ser divisível po 400.
# Se o ano não respeitar essas regras, ele não é caracterizado como bissexto.

# utilizamos uma variável com a função input, para quem estiver ultilizando o programa, puder escolher livremente o ano. OBS: coloquei a função int, para transformar a string ou texto em um número inteiro, para podermos trabalhar com ele.
ano = int(input('Escolha um ano: '))

# Abaixo, basicamente, montei uma conta da qual explicita as regras acima. Primeira parte do código explica que, se o ano for divisível por 4 e também não for divisível por 100 ele é bissexto->.
# Agora se o ano for divisível por 4 e também for divisível por 100, entraremos na segunda parte, da qual ele obrigatoriamente tem quer divisível por 400, caso contrário, ele não será bissexto.
# Por que colocamos o número 100 dessa maneira? O número 100 é colocado na linha de código para quando aparcer algum número que seja divisível por 100 e por 4, ser jogado diretamente para a segunda parte, na divisão com o 400.
# Isso é feito para que anos como, 100, 1500, 1900, não sejam caracterizados como anos bissextos.

# Já a função else, mostra que, tudo aquilo que não esteja caracterizado na função if, seja um ano não bissexto.
if ano % 4 == 0 and ano % 100 != 0 or ano % 400 == 0:
    print('O ano {} é bissexto.'.format(ano))
else:
    print('O ano {} não é bissexto.'.format(ano))


