# <img src='https://img.quizur.com/f/img60b2efdcc106d2.75161712.jpg?lastEdited=1622339554' height="100%" width="480" style="margin-left: auto;margin-right: auto"> 
#  
# *Alice aprendeu recentemente os nomes de todos os personagens que vivem no País das Maravilhas, mas sua memória é muito ruim, por isso ela resolveu que irá lembrar somente as vogais do nome de cada um (vai entender!).*
# 
# Ajude Alice com esta tarefa! Crie um programa que lerá **cada** nome da tupla fornecida e retorne como output **as vogais desses nomes.**
# 
# Print sua resposta da seguinte forma -> **Na palavra RAINHA    temos as vogais: a i a** (sim, o output é em letra minúscula)

# In[33]:


# Use a tupla abaixo para resolver este exercício
words = ('COELHO BRANCO', 'CHAPELEIRO MALUCO', 'RAINHA VERMELHA', 'LARGARTA', 'LEBRE DE MARÇO', 'GATO DE CHESHIRE', 'VALETE DE COPAS',
        'TWEEDLEDEE', 'TWEEDLEDUM')

#####SEU CODIGO COMECA AQUI#####
# Primeiro criamos uma variável string para identificarmos as vogais nas palavras que queremos.
vogais = 'aeiou'
# Em seguida criamos um laço de repetição com o comando for, ou seja, ao invés de ficarmos printando palavra por palavra em cada frase, criamos uma frase única para todas as palavras dentro da tupla de uma vez só, utilizando o comando for
#OBS: Atentar se á o "f" de formatação antes de começar a frase printada, sem ele as palavras da tupla não aparecem, ao ivém delas apareceria apenas a letra w.
for w in words:
    print(f'\nNa palavra {w} temos as vogais: ', end='')
    # Logo após, criamos um outro for dentro de outro for, por que? Simples, além de querermos que ele repita as palavras da tupla, também queremos que ele repita as vogais de cada palavra em seguida. Lembrando que os componentes da tupla são várias listas, sendo possível retirar elementos específicos delas, assim como estamos fazendo com as vogais.
    # (continuarei por aqui para não deixar meu código muito poluído).Em seguida, peço para meu programa, através do comando if, printar apenas as letras das palavras que também se encontram na minha variável 'vogais'.
    # Printo a letra e obtenho minha resposta.
    # OBS: .lower() foi ultilizado para reconhecer as vogais maiúsculas e passar elas para minúsculas. (\n) e (end= '') foram utilizados para formatação do texto, deixar ele mais apresentável, quebrando a pagína e deixando ele retilíneo e espaçado da forma correta.
    for letra in w:
        if letra.lower() in vogais:
            print(letra.lower(), end=' ')


# ## **Ex. 5 - Greed**
# 
# ![troco.png](data:image/png;base64,)

# *Se você já passou por essa situação e sabe como pode ser constrangedor ficar na dúvida, imagine para o cara que trabalha dentro do caixa eletrônico. 
# O quê? Não sabia que existe uma pessoa lá dentro? Ainda tem muito a aprender então.*

# ![image.png](data:image/png;base64,)

# *Para ajudar essa sofrida e ignorada classe de profissionais, ajude Alice a criar um programa que simule o funcionamento de um caixa eletrônico.*
# 
# No início, pergunte ao usuário qual será o valor a ser sacado (número inteiro) e o programa vai informar qual a menor quantidade de cada cédula será entregue.
# 
# Obs: considere que o caixa possui cédulas de R$ 100, 50, 20, 10 e 1.
# 
# Exemplo 1 - Se o valor a ser sacado for de **26 reais** o programa deve retornar:
# 
# **Total de notas para poder sacar R$ 26,00:**
# 
# **Notas de 20: 1**
# 
# **Notas de 1: 6**
# 
# <br/>Exemplo 2 - Se o valor a ser sacado for de **181 reais** o programa deve retornar:
# 
# **Total de notas para poder sacar R$ 181,00:**
# 
# **Notas de 100: 1**                              
# **Notas de 50: 1**                              
# **Notas de 20: 1**                              
# **Notas de 10: 1**                              
# **Notas de 1 : 1**

# In[97]:


#####SEU CÓDIGO COMEÇA AQUI#####
valor = int(input('Qual valor você deseja sacar?: ')) # Primeiro associei o input a variável montante para ficar mais fácil a compreensão.
montante = valor
cedula = 100 # variável que começa com a cédula inicial.
totalced = 0 # Total de cédulas que será reportado no programa.
print(f'Total de notas para poder sacar R$ {montante}')
while True:
    if montante >= cedula: # Qual a idéia do programa? Nesse ponto, é reconhecer o montante, e enquanto ele for maior ou igual a cédula 100, ele passa para a próxima cédula, até zerar, quando zerar, o programa estopa.
        montante -= cedula  # reperesenta o montante diminuindo
        totalced += 1  # representa o total de cédulas aumentando de acordo com que vão sendo usadas.
    else:
        if totalced > 0:# essa linha foi feita para, quando o o montante não precisar de uma certa cédula, por exemplo '120', ele so´vai precisar de uma de 100 e outra de 20, o restante não precisa aparecer no print, ou seja, sem essa linha de comando o restante aparece no print com índice 0
            print(f'Notas de R$ {cedula}: {totalced}')
        if cedula == 100:
            cedula = 50
        elif cedula == 50:
            cedula = 20
        elif cedula == 20:
            cedula = 10
        elif cedula == 10:
            cedula = 1
        totalced = 0
        if montante == 0:
            break # Por fim é ultilizado esse comando para estopar a operação.


# ## **Ex.6 - FEA.Dev SA**
# *Depois de muitos anos realizando seu trabalho de aproximar a programação à vida dos uspianos, o FEA.dev decidiu que estava na hora de expandir suas operações e resolveu abrir capital na bolsa de valores (FDEV3). Inicialmente, Alice fica toda animada com a possibilidade de ser não apenas membro, mas também sócia! Só que... qual é o preço certo a se pagar por isso? É a pergunta que todos os investidores se fazem e, embora não tenha uma única resposta certa, um método muito comum de precificação é o Fluxo de Caixa Descontado.*
