# Nesse método, considera-se que o valor presente de uma ação são fluxos de caixa a serem gerados no futuros, descontados por uma taxa que reflete o custo de oportunidade desse dinheiro investido. **Artigo para referência: https://www.suno.com.br/artigos/fluxo-de-caixa-descontado/**
