# - Calcule o valor presente do fluxo de caixa e com base nisso responda qual será o preço uma ação FDEV3 considerando que foram emitidos 5600 papeis;
# - Printe esse valor em **negrito**;
# - Não esqueça de colocar apenas 2 casas decimais.
# 
# **Dica: Preço da ação = Valor presente do fluxo / Qt. de Ações**
# 

# In[4]:


#####SEU CODIGO COMECA AQUI#####
