a3 = 187000/(1.1175**3)
a4 = 150000/(1.1175**4)
a5 = 4500/(1.1175**5)

#U + 1F923
valpre = a1 + a2 + a3 + a4 +a5 # Logo após, cria-se outra variável "valor presente", onde soma-se todos os fluxos de caixa já tragos a valor presente.

